#define N_OUTPUTSPC sizeof(dataInputs1)/sizeof(dataInputs1[0])
static char *(pcnames[]) =
	{
		"nextPC",
		"Jumps",
		"JALR",
		"Except_addr",
	};
struct inputsPC
{
	int addr1;
	int addr2;
	int addr3;
	int pcsel;
	int stall;
	char *strpcsel;
};


static void parseInputsPC(struct inputsPC *ins,int n)
{
	int d1 = dataInputs1[n];
	int d2 = dataInputs2[n];

	ins->pcsel = d1&3;
	ins->stall = d2&1;
	ins->addr1 = d1& 0xf0f0f0f0;
	ins->addr2 = d1& 0x0f0f0f0c;
	ins->addr3 = d2& 0xfffffffe;
	ins->strpcsel = pcnames[ins->pcsel];
}

void configtbPC(struct tbconfig *tbcfg)
{
	tbcfg->source1 = dataInputs1;
	tbcfg->source2 = dataInputs2;
	tbcfg->sourcelen = sizeof(dataInputs1);
	tbcfg->resultslen = sizeof(dataInputs1);
}

int genresultsPC()
{
	return sizeof(dataInputs1);
}

int CheckResultsPC(int *PC2check,int *NPC2check)
{
	int cnt = 0;
	struct inputsPC ins;
	for (int i = 0; i<N_OUTPUTSPC-1;i++)
	{
		if(PC2check[i+1] != pc[i])
		{
			cnt++;
			parseInputsPC(&ins,i);
			xil_printf("--- PCstr:%s, PCsel:%d,stall:%d, addr1:%x, addr2:%x, addr3:%x\r\n",ins.strpcsel,ins.pcsel,ins.stall,ins.addr1,ins.addr2,ins.addr3);
			xil_printf("--- mismatch at pc[%d], expected %x, real %x --- \r\n",i,pc[i],PC2check[i+1]);
		}
		if(NPC2check[i+1] != nextpc[i])
		{
			cnt++;
			xil_printf("--- mismatch at nextpc[%d], expected %x, real %x --- \r\n",i,nextpc[i],NPC2check[i+1]);
		}
	}

	return cnt;
}
